import React, { useState } from "react";
import "./App.css";
import { motion } from "framer-motion";
import { Lock, Unlock, Shield, Copy } from "lucide-react";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

const App = () => {
  const [file, setFile] = useState(null);
  const [algorithm, setAlgorithm] = useState("AES");
  const [key, setKey] = useState("");
  const [downloadLink, setDownloadLink] = useState("");

  const backendURL = "http://127.0.0.1:5000";

  const handleFileChange = (e) => setFile(e.target.files[0]);

  const handleGenerateKey = async () => {
    if (algorithm === "RSA") {
      toast.info("RSA keys are auto-generated during encryption");
      return;
    }
    const res = await fetch(`${backendURL}/generate-key`, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ algorithm }),
    });
    const data = await res.json();
    if (data.key) {
      setKey(data.key);
      toast.success("Key generated successfully!");
    }
  };

  const handleEncrypt = async () => {
    if (!file) return toast.error("Please upload a file first!");

    const formData = new FormData();
    formData.append("file", file);
    formData.append("algorithm", algorithm);

    const res = await fetch(`${backendURL}/encrypt`, { method: "POST", body: formData });
    if (!res.ok) return toast.error("Encryption failed!");

    const blob = await res.blob();
    const keyHeader = res.headers.get("X-Encryption-Key");
    if (keyHeader) setKey(keyHeader);

    const url = window.URL.createObjectURL(blob);
    setDownloadLink(url);
    toast.success("File encrypted successfully!");
  };

  const handleDecrypt = async () => {
    if (!file || !key) return toast.error("Please provide both file and key!");

    const formData = new FormData();
    formData.append("file", file);
    formData.append("algorithm", algorithm);
    formData.append("key", key);

    const res = await fetch(`${backendURL}/decrypt`, { method: "POST", body: formData });
    if (!res.ok) return toast.error("Decryption failed!");

    const blob = await res.blob();
    const url = window.URL.createObjectURL(blob);
    setDownloadLink(url);
    toast.success("File decrypted successfully!");
  };

  return (
    <div className="app-container">
      <ToastContainer />
      <motion.div
        className="card"
        initial={{ opacity: 0, y: -20 }}
        animate={{ opacity: 1, y: 0 }}
      >
        <h1 className="title"><Shield size={32} /> SecureScan Encryption Suite</h1>

        <div className="dropdown">
          <label>Choose Encryption:</label>
          <select value={algorithm} onChange={(e) => setAlgorithm(e.target.value)}>
            <option value="AES">AES</option>
            <option value="RSA">RSA</option>
            <option value="Fernet">Fernet</option>
          </select>
        </div>

        <input type="file" onChange={handleFileChange} className="file-input" />

        <div className="buttons">
          <button onClick={handleGenerateKey}>Generate Key</button>
          <button onClick={handleEncrypt}><Lock size={18} /> Encrypt</button>
          <button onClick={handleDecrypt}><Unlock size={18} /> Decrypt</button>
        </div>

        {key && (
          <div className="key-box">
            <p><b>Key:</b> {key.slice(0, 60)}...</p>
            <button onClick={() => navigator.clipboard?.writeText(key)}><Copy size={16} /> Copy</button>
          </div>
        )}

        {downloadLink && (
          <a className="download-btn" href={downloadLink} download>
            Download Result
          </a>
        )}
      </motion.div>
    </div>
  );
};

export default App;
